
# This is a random torch model generated by the following modules: ['FractionalMaxPool3d', 'MaxUnpool3d', 'InstanceNorm2d', 'ELU']
import torch
import torch.nn as nn
import torch.nn.functional as F


class Model(nn.Module):
    def __init__(self) -> None:
        super().__init__()
        self.fractional_max_pool3d = nn.FractionalMaxPool3d(kernel_size=2, output_size=(8, 8, 8))
        self.max_unpool3d = nn.MaxUnpool3d(kernel_size=2, stride=2)
        self.instance_norm2d = nn.InstanceNorm2d(10)
        self.elu = nn.ELU()

    def forward(self, x):
        # Assume input is 5D (batch, channels, depth, height, width)
        # Apply FractionalMaxPool3d
        x, indices = self.fractional_max_pool3d(x)
        
        # Apply MaxUnpool3d
        x = self.max_unpool3d(x, indices)
        
        # Reshape to 4D (batch, channels, height, width) for InstanceNorm2d
        batch_size, channels, depth, height, width = x.shape
        x = x.view(batch_size, channels * depth, height, width)
        
        # Apply InstanceNorm2d
        x = self.instance_norm2d(x)
        
        # Reshape back to 5D
        x = x.view(batch_size, channels, depth, height, width)
        
        # Apply ELU
        x = self.elu(x)
        
        return x


